import { Component } from "react";

const styles = {
    navbar:{
        backgroundColor:'#f1f1',
        padding:'30px 0 px'
    }
}

class Navbar extends Component{
    render(){
        return(
            <nav style={styles.navbar}>
                <p>Logo</p>
                <p>Carro</p>
            </nav>
        )
    }
}

export default Navbar
